import { Link } from "react-router-dom";

//Link toの文字列は、Appに書いたRoute pathと合わせる必要がある

function Top() {
  const top = (
    <div id="top">
      <h1>apln-nのページ</h1>
      <h2>コンテンツ:</h2>
      <div>
        <p><Link to="/tutorial">チュートリアル(三目並べ)</Link></p>
        <p><Link to="/Janken">じゃんけん</Link></p>
        <p><Link to="/">Topページ</Link></p>
      </div>
    </div>
  );
  return (top);
}

//export default [クラス名]、の形で絶対に書く必要。
export default Top;
